import React, { Component } from "react";
class Archives extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <a href="/" className="">
          Photographs
        </a>
        <a href="/" className="">
          Video Files
        </a>
        <a href="/" className="">
          Audio Files
        </a>
      </div>
    );
  }
}

export default Archives;
